import{_ as t,c as r,a0 as s,j as n,o as a}from"./chunks/framework.DX7EX5Ix.js";const i="/assets/pc_ui.CHsxzEVr.png",f=JSON.parse('{"title":"Interface","description":"","frontmatter":{},"headers":[],"relativePath":"usage/ui.md","filePath":"src/usage/ui.md"}'),o={name:"usage/ui.md"};function l(d,e,u,c,p,g){return a(),r("div",null,e[0]||(e[0]=[s('<h1 id="interface" tabindex="-1">Interface <a class="header-anchor" href="#interface" aria-label="Permalink to &quot;Interface&quot;">​</a></h1><p>Voici la liste des écrans de Présences et le détail de son organisation. Vous pouvez retrouver l&#39;ensemble des fonctionnaliés sur la liste des <a href="./features">Fonctionnalités</a>.</p><h2 id="accueil" tabindex="-1">Accueil <a class="header-anchor" href="#accueil" aria-label="Permalink to &quot;Accueil&quot;">​</a></h2><p>Cette page sera l&#39;endroit où chaque utilisateur pourra voir quel poste sont occupé ou libre, et choisir de s&#39;inscire sur un bureau.</p>',4),n("img",{src:i,alt:"user ui",onclick:"window.open(this.src)",style:{cursor:"pointer"}},null,-1),s('<p><em><strong>1)</strong> Calendrier <strong>2)</strong> Journée <strong>3)</strong> Plans <strong>4)</strong> Utilisateur <strong>5)</strong> Postes <strong>6)</strong> Cartes <strong>7)</strong> Légende</em></p><ul><li><span id="calendrier" class="title-dot"><div class="dot">1</div><strong>Calendrier</strong></span> Le calendrier affiche la liste des jours de la semaine courante et du(des) semaine(s) suivante(s). Les journées passées sont grisées et celles à venir sont colorées normalement. Le calendrier regroupe les journées par semaine, et intitule chaque groupe avec le numéro de la semaine dans l&#39;année. <br><br></li><li><span id="journee" class="title-dot"><div class="dot">2</div> <strong>Journée</strong></span> Les journées sont représentées par des cartes divisées en deux parties. La partie haute contient la date du jour, ainsi qu&#39;un bouton permettant de s&#39;inscrire sur un poste. La partie basse contient tous les trigrammes (identifiant d&#39;une personne) qui se sont inscris sur un poste cette journée. <br><br></li><li><span id="plans" class="title-dot"><div class="dot">3</div> <strong>Plans</strong></span> La liste des plans permet de naviguer entre les différents espaces. <br><br></li><li><span id="utilisateur" class="title-dot"><div class="dot">4</div> <strong>Utilisateur</strong></span> Ce trigramme représente l&#39;utilisateur courant. En cliquant dessus, il pourra accèder au <a href="./features#ii-personnalisation-de-lexpérience">Menu de configuration</a>. <br><br></li><li><span id="poste" class="title-dot"><div class="dot">5</div> <strong>Poste</strong></span> Les postes représentent les entités qu&#39;un utilisateur peut réserver. Il existe plusieurs types de poste, définis par la couleur de son contour(les types sont décrits dans la légende). Les postes réservés affichent le trigramme de la personne inscrite en son centre. Au survol d&#39;un poste, les informations complémentaires de ce dernier sont affichées. <br><br></li><li><span class="title-dot"><div class="dot">6</div> <strong>Carte</strong></span> La carte permet de naviguer dans les locaux. Elle est interactive, et peut donc être zoomer et déplacer. <br><br></li><li><span class="title-dot"><div class="dot">7</div> <strong>Légende</strong></span> La légende décrit les différents type de postes existant sur le carte et informe sur la signification des contours des postes. <br><br></li></ul>',2)]))}const v=t(o,[["render",l]]);export{f as __pageData,v as default};
